import React from 'react';
import styles from './Navbar.module.css';

const Navbar = () => {
  const menu = [
    'News',
    'Feed',
    'Inbox',
    'My Pages',
    'Friends',
    'Images',
    'Videos',
    'Messages',
    'Notifications',
    'People',
    'Nearby',
    'Insights',
    'Logout',
  ];
  return (
    <nav className={styles.nav}>
      <div>
        <div>
          <div>Shortcuts</div>
        </div>
        <div></div>
      </div>
    </nav>
  );
};
export default Navbar;
